import React from "react";
import '../assets/signup.css'
import {Label, Input, Form, FormGroup, Button} from 'reactstrap';
import Wave from "react-wavify";


export const Signin = () => {
    return (
        <>
            <Form className="login-form">
                <h1 className="text-center">Company Services</h1>
                <h3 className="text-center p-2">Welcome</h3>
                <FormGroup>
                    <Input type="email" placeholder="E-mail"/>
                </FormGroup>
                <FormGroup>
                    <Input type="password" placeholder="Password"/>
                </FormGroup>
                <Button className="btn-lg btn-dark w-100" color="primary">Sign In</Button>
                <div className="text-center pt-3"> Do not you have an account?</div>
                <div className="text-center">
                    <a href="/signup">Sign Up</a>
                    <span className="p-2"> | </span>
                    <a href="/forgotpassword">Forgot Password</a>
                </div>
            </Form>
            <Wave fill='#1a2848'
                  paused={false}
                  options={{
                      height: 20,
                      amplitude: 40,
                      speed: 0.1,
                      points: 4
                  }}
            />
        </>
    )
}
